geregisseerd door Stephen Shimek
met Luke Perry, Brooke Langton en Ariana Bagley

Kassie Stevenson, haar vrienden en haar trouwe hond Scoot worden tijdens de zomervakantie van de verveling gespaard, wanneer ze een mysterieus zakhorloge in handen krijgen, waarmee ze het geheim kunnen ontdekken van het legendarische 'Garrison's goud'. Met twee boeven op hun hielen, is het aan Kassie en haar vrienden om de puzzel van de verloren schat op te lossen. Tegelijkertijd struikelen Scoot en Paul Stevenson, Kassie's vader, ook over een schat: de liefde.


